import AlertInstructions from "../components/AlertInstructions";

function Match() {
    return(
        <div className="wrapper">
            <h2 className="ms-4 mt-4 mb-2">Match startups and investors</h2>
            <p className="ms-4 mb-4">Upload the excel file (.xlsx) with the correct format to start. You may refer to this template.</p>
            <form className="form-group custom-form d-flex ms-4 me-4">
                <input type="file" className="form-control" required />
                <button type="submit" className="btn btn-success btn-md ms-2">Upload</button>
            </form>
        </div>
    )
}

export default Match;
